import React, { useState, useEffect, useRef } from 'react';
import { NavigationController } from '../../controllers/NavigationController';
import { FaInstagram, FaTiktok, FaFacebook, FaYoutube, FaWhatsapp, FaBars, FaTimes } from 'react-icons/fa';

const Navbar = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isWhiteBackground, setIsWhiteBackground] = useState(false);
  const [isVisible, setIsVisible] = useState(true);
  const lastScrollY = useRef(0);
  const menuItems = NavigationController.getMenuItems();
  const socialLinks = NavigationController.getSocialLinks();

  useEffect(() => {
    const heroSection = document.querySelector('.hero-section');

    const observer = new IntersectionObserver(
      ([entry]) => {
        setIsWhiteBackground(!entry.isIntersecting);
      },
      { threshold: 0.1 }
    );

    if (heroSection) {
      observer.observe(heroSection);
    }

    const handleScroll = () => {
      const currentScrollY = window.scrollY;

      if (currentScrollY > lastScrollY.current) {
        setIsVisible(false);
      } else {
        setIsVisible(true);
      }

      lastScrollY.current = currentScrollY;
    };

    window.addEventListener('scroll', handleScroll, { passive: true });

    return () => {
      if (heroSection) {
        observer.unobserve(heroSection);
      }
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const getIcon = (platform) => {
    switch (platform) {
      case 'instagram': return <FaInstagram />;
      case 'tiktok': return <FaTiktok />;
      case 'facebook': return <FaFacebook />;
      case 'youtube': return <FaYoutube />;
      case 'whatsapp': return <FaWhatsapp />;
      default: return null;
    }
  };

  const navbarClasses = `
    w-full transition-all duration-300 ease-in-out
    ${isWhiteBackground ? 'bg-white shadow-md' : 'bg-transparent'}
    ${isVisible ? 'translate-y-0' : '-translate-y-full'}
    ${isWhiteBackground ? 'fixed top-0 left-0 right-0' : 'absolute top-0 left-0 right-0'}
  `;

  return (
    <nav className={navbarClasses}>
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between items-center py-4">
          <div className="flex items-center">
            <img src="/placeholder.svg?height=48&width=48" alt="Hay Cafe" className={`h-12 w-auto transition-all duration-300 ${isWhiteBackground ? '' : 'filter invert'}`} />
          </div>

          <div className="hidden md:flex items-center space-x-8">
            <ul className="flex space-x-6">
              {menuItems.map((item) => (
                <li key={item.id}>
                  <a 
                    href={item.path}
                    className={`transition-colors ${isWhiteBackground ? 'text-[#8B4513] hover:text-[#A0522D]' : 'text-white hover:text-gray-300'}`}
                    onClick={(e) => {
                      e.preventDefault();
                      NavigationController.handleNavigation(item.path);
                    }}
                  >
                    {item.label}
                  </a>
                </li>
              ))}
            </ul>

            <div className="flex space-x-4">
              {socialLinks.map((link) => (
                <a
                  key={link.id}
                  href={link.url}
                  className={`transition-colors ${isWhiteBackground ? 'text-[#8B4513] hover:text-[#A0522D]' : 'text-white hover:text-gray-300'}`}
                  target="_blank"
                  rel="noopener noreferrer"
                >
                  {getIcon(link.platform)}
                </a>
              ))}
            </div>
          </div>

          <div className="md:hidden">
            <button
              onClick={() => setIsMenuOpen(!isMenuOpen)}
              className={`focus:outline-none ${isWhiteBackground ? 'text-[#8B4513]' : 'text-white'}`}
            >
              {isMenuOpen ? <FaTimes size={24} /> : <FaBars size={24} />}
            </button>
          </div>
        </div>
      </div>

      {isMenuOpen && (
        <div className={`md:hidden ${isWhiteBackground ? 'bg-white' : 'bg-[#8B4513] bg-opacity-90'}`}>
          <div className="px-2 pt-2 pb-3 space-y-1 sm:px-3">
            {menuItems.map((item) => (
              <a
                key={item.id}
                href={item.path}
                className={`block px-3 py-2 rounded-md text-base font-medium ${
                  isWhiteBackground 
                    ? 'text-[#8B4513] hover:bg-[#F5F5F5]' 
                    : 'text-white hover:bg-[#A0522D] hover:text-white'
                }`}
                onClick={(e) => {
                  e.preventDefault();
                  NavigationController.handleNavigation(item.path);
                  setIsMenuOpen(false);
                }}
              >
                {item.label}
              </a>
            ))}
          </div>
          <div className="px-5 py-3 flex justify-center space-x-4">
            {socialLinks.map((link) => (
              <a
                key={link.id}
                href={link.url}
                className={`transition-colors ${
                  isWhiteBackground 
                    ? 'text-[#8B4513] hover:text-[#A0522D]' 
                    : 'text-white hover:text-gray-300'
                }`}
                target="_blank"
                rel="noopener noreferrer"
              >
                {getIcon(link.platform)}
              </a>
            ))}
          </div>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
